async function getServerSideProps(ctx) {
    const page = parseInt(ctx.query.page || '1', 10);
    const limit = 10;
    try {
        const res = await fetch(`http://localhost:3000/api/v1/articles?page=${page}&limit=${limit}`);
        if (!res.ok) throw new Error('api error');
        const json = await res.json();
        return {
            props: {
                articles: json.value || [],
                page,
                limit,
                total: json.Count || 0
            }
        };
    } catch (err) {
        return {
            props: {
                articles: [],
                page,
                limit,
                total: 0
            }
        };
    }
}
